desc:
ЭЗС работает через мобильное приложение Sitronics Electro: https://onelink.to/bnmtrz

Станция находится на подземном паркинге ТЦ "Павелецкая Плаза", сектор Н01

• CCS Combo 2 — до 100 кВт;
• CHAdeMO — до 60 кВт;
• Type 2 — до 22 кВт.

*Зарядная станция переменного тока;
*Mennekes amtron basic R 22C;
*С кабелем и штекером Type 2.
Станция расположена на территории завода.
Въезд строго по пропускам.
